import { HeaderWrap, ExtraTopbar, Topbar, Logo } from "./Header.styles";
import Nav from "../Nav/Nav";
import menu from "../../database/menu.json";
// import { ReactComponent as Logo } from "./../../assets/logo.svg";

function Header() {
  const topbarMenu = menu.topbar;
  const extraTopbarMenu = menu.extratopbar;

  return (
    <>
      <ExtraTopbar>
        {extraTopbarMenu.map((item, index) => {
          return <NavItem key={index}>{item.title}</NavItem>;
        })}
      </ExtraTopbar>
      <HeaderWrap>
        <Topbar>
          <Logo />
          <Nav menu={topbarMenu} />
          {/* <HeaderOptions /> */}
        </Topbar>
      </HeaderWrap>
    </>
  );
}

export default Header;
